<div class="card">
   <div class="card-header">
      <a class="collapsed card-link" data-toggle="collapse" href="#collapseOne2" aria-expanded="true">Do the premium proxies support username:password authentication?<span></span></a>
   </div>
   <div id="collapseOne2" class="collapse" data-parent="#accordion" style="">
      <div class="card-body">No, our premium proxies do not support username:password authentication. This is because we bill depending on the amount of authenticated devices.</div>
   </div>
</div>
<div class="card">
   <div class="card-header">
      <a class="collapsed card-link" data-toggle="collapse" href="#collapseOne3" aria-expanded="true">When does the proxy list refresh?<span></span></a>
   </div>
   <div id="collapseOne3" class="collapse" data-parent="#accordion" style="">
      <div class="card-body">The premium proxy list does not refresh. If your proxies get banned too quickly, it is recommended to buy a bigger package. For very sensitive websites, we recommend using <a style="text-decoration: underline;" href="https://proxyscrape.com/residential-proxies">rotating residential proxies</a> instead.</div>
   </div>
</div>
<div class="card">
   <div class="card-header">
      <a class="collapsed card-link" data-toggle="collapse" href="#collapseOne4" aria-expanded="true">Are the premium proxies rotating?<span></span></a>
   </div>
   <div id="collapseOne4" class="collapse" data-parent="#accordion" style="">
      <div class="card-body">No, our premium proxies are static datacenter proxies. If you are looking for rotating proxies, please take a look at our <a href="https://proxyscrape.com/residential-proxies" style="text-decoration: underline;">residential proxies</a>.</div>
   </div>
</div>
<div class="card">
   <div class="card-header">
      <a class="collapsed card-link" data-toggle="collapse" href="#collapseOne5" aria-expanded="true">What will happens if proxies get banned on my target website?<span></span></a>
   </div>
   <div id="collapseOne5" class="collapse" data-parent="#accordion" style="">
      <div class="card-body">If a proxy gets banned on your target website, you will be unable to use it for that website for the duration of the ban. We recommend you buy enough proxies to keep your activities running smoothly and account for bans.</div>
   </div>
</div>
<div class="card">
   <div class="card-header">
      <a class="collapsed card-link" data-toggle="collapse" href="#collapseOne6" aria-expanded="true">Do you replace dead proxies?<span></span></a>
   </div>
   <div id="collapseOne6" class="collapse" data-parent="#accordion" style="">
      <div class="card-body">Our premium subscriptions do not contain any dead proxies. If some proxies are marked as offline, you can be sure our 24/7 monitoring team is working on getting them back online as soon as possible. If you are experiencing issues with the proxies for a long duration, please feel free to contact our support team</div>
