   </div>
   <div id="collapseOne9" class="collapse" data-parent="#accordion2" style="">
      <div class="card-body">You can only change your proxy list by upgrading your account. If your proxies are not working correctly from the start, we recommend you contact our support as soon as possible so we can troubleshoot the issue. We might suggest replacing your package with another proxy type free of charge. If your proxies are banned because you actively used them, we do not provide any proxy changes and recommend upgrading your account to a bigger package to prevent bans.</div>
